import Login from "../login/login";
import Inicio from '../index/index';

export default function AppRouter() {
    
        return (  
            <Router>
                <Routes>
                    <Route exact path="/login" element ={<Login/>} />
                    <Route exact path="/index" element ={<Inicio/>} />
                    <Route exact path="/" element ={<Inicio/>} />
